        file.read_line_from_file(line);
        occurrences.push_back(line.lower());
        if (line == word) {
            count++;
        }
    }
    file.close();
    // Return the word count
    return count;
}

int main() {
    // Prompt the user to enter the word to be searched for
    std::cout << "Enter the word to search for: ";
    std::string word;
    std::cin >> word;
    // Open the file for reading
    std::ifstream file(word);
    if (!file.is_open()) {
        std::cerr << "Error opening file " << word << std::endl;
        return 1;
    }
    std::string line;
    while (file.is_open()) {
        std::string line;
        file.read_line_from_file(line);
        occurrences.push_back(line.lower());
    }
    file.close();
    // Count the occurrences of the word
    int word_count = count_occurrences(word);
    std::cout << "The word '" << word << "' appears " << word_count << " times in the file." << std::endl;
    return 0;
}
