### Explanation:
1. **Reading Lines from the File**: The `read_line_from_file` function reads a line from the file and converts it to lowercase for case-insensitive counting.
2. **Counting Occurrences**: The `count_occurrences` function reads the file line by line and counts the occurrences of the specified word. It stores the word in a vector of integers.
3. **Main Function**: The `main` function prompts the user to enter a word, opens the file, reads the lines, and counts the occurrences of the word. Finally, it prints the word count.

